def load_pickle_file(pkl_path):
    return pickle.load( open( pkl_path, "rb" ) )

def loop_cities_dict(cities):
    for city in cities.keys():
        first = f"data/first_selenium_scrape/{city}_final.pkl"
        len_first = get_pickle_length(first)
        second = f"data/cities_final/{city}_final.pkl"
        len_second = get_pickle_length(second)
        print(f'{city}: First: {len_first} -- Second: {len_second}')

def get_pickle_length(pkl_path):
    links = load_pickle_file(pkl_path)
    return (len(links))

def print_pickle_file(pkl_path):
    file = load_pickle_file(pkl_path)
    print(file)
    return file

def list_file_in_dir(path):
    file_list = [path + f for f in listdir(path) if isfile(join(path, f))]

    print(file_list)

def save_pickle(list_to_save, pickle_file_name):
    #pickle.dump(ls, open( "nyc_links_leftovers_1.pkl", "wb" ) )
    pickle.dump(list_to_save, open( pickle_file_name, "wb" ) )

def backup_therapists_table():
    sql = """
        SELECT *
        FROM therapists
    """

    conn = psycopg2.connect(dbname='therapist_predictor', user='postgres', host='localhost', password='password')
    cur = conn.cursor()

    # outputquery = "COPY ({0}) TO STDOUT WITH CSV HEADER".format(query)

    # with open('data/postgres_therapists_backup.csv', 'w') as f:
    #     cur.copy_expert(outputquery, f)

    df = pd.read_sql_query(sql, conn)

    conn.close()
    pickle.dump(df, open( 'data/backups/therapist_table_backup.pkl', "wb" ) )
    return df

